import React from "react";
import "./projects.css";

const Projects = () => {
  return (
    <section className="projects container section" id="projects">
      <h2 className="section-title">- Projects</h2>
      <p className="des">
        (created by WordPress, and customised by html, css, and jQuery)
      </p>
      <div className="work-filters">
        <span className="work-item">Everything</span>
        <span className="work-item">Personal Websites</span>
        <span className="work-item">Ecommerce Websites</span>
        <span className="work-item">Business Websites</span>
      </div>
    </section>
  );
};

export default Projects;
